import { genreDTO } from "./genres.mode";
import { urlGenres } from "../endpoints";
import IndexEntity from "../utils/IndexEntity";

export default function IndexGenres() {
  return (
    <>
      <IndexEntity<genreDTO>
        url={urlGenres}
        createURL="/genres/create"
        title="Genres"
        entityName="Genre"
      >
        {(genres, buttons) => (
          <>
            <thead>
              <tr>
                <th></th>
                <th>Name</th>
              </tr>
            </thead>
            <tbody>
              {genres?.map((genre) => (
                <tr key={genre.id}>
                  <td>
                    {buttons(`genres/edit/${genre.id}`, genre.id)}
                  </td>
                  <td>{genre.name}</td>
                </tr>
              ))}
            </tbody>
          </>
        )}
      </IndexEntity>
    </>
  );
}
